import React from 'react';
import { NavLink } from 'react-router-dom';



const Common = (props) => {
    return(
    <>
       
                        <div className=" bg-danger col-lg-5 col-md-5 col-10 mx-auto pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column">
                            <h1>
                                {props.name}<br></br><strong className=" brand-name">{props.brand}</strong>
                            </h1>

                            <div className="groupimg ">
                               <img src={props.group} className="img-fluid"  />
                            </div>
                            <h2 className=" my-2">
                                {props.abt}
                            </h2>
                            <div className="mt-3">
                                <NavLink to={props.visit} className=" btn-get-started ">{props.btname}</NavLink>
                            </div>
                        </div>

                        <div className=" bg-info col-lg-6 col-md-6 col-10 mx-auto order-1 order-lg-2 header-img">
                            <img src={props.sideimg} className="img-fluid animated" alt="about img" />
                        </div>
  
    </>
    )
}

export default Common;
